import React from 'react'

function InputComponent({
	inputType,
	label,
	onChange
}) {
  return (
    <>
      <form>
        <label> {label}
          <input type={inputType} required onChange={onChange}></input>
        </label>             
      </form>                                
    </>
  );
}

export default InputComponent
